import { AppBar, Box, Toolbar, Typography, Menu, MenuItem } from "@mui/material";
import { useState } from "react";
import ArrowDropDownIcon from "@mui/icons-material/ArrowDropDown"; // Import dropdown arrow icon
import ArrowRightIcon from "@mui/icons-material/ArrowRight"; // Import right arrow for nested menu

function Navbar() {
  const [anchorEl, setAnchorEl] = useState(null);
  const [subMenuAnchorEl, setSubMenuAnchorEl] = useState(null);

  const creditCards = [
    { name: "HDFC Bank Credit Card", details: ["HDFC Millennia", "HDFC Freedom"] },
    { name: "SBI Credit Card", details: ["SBI SimplySave", "SBI SimplyClick"] },
    { name: "Popular Credit Card", details: ["Amazon Pay Card", "Flipkart Axis Card"] },
    { name: "IDFC Bank Credit Card", details: ["IDFC Wealth", "IDFC Select"] },
    { name: "Axis Bank Credit Card", details: ["Axis Vistara", "Axis Privilege"] },
    { name: "HSBC Bank Credit Card", details: ["HSBC Cashback", "HSBC Platinum"] },
    { name: "AU Bank Credit Card", details: ["AU Xcite", "AU LIT"] },
    { name: "American Express Credit Card", details: ["Amex Gold", "Amex Platinum"] },
    { name: "ICICI Bank Credit Card", details: ["ICICI Amazon Pay", "ICICI Coral"] },
    { name: "IndusInd Bank Credit Cards", details: ["IndusInd Legend", "IndusInd Nexxt"] },
  ];

  // Handle dropdown open/close
  const handleMenuOpen = (event) => setAnchorEl(event.currentTarget);
  const handleMenuClose = () => {
    setAnchorEl(null);
    setSubMenuAnchorEl(null);
  };

  // Handle nested dropdown open/close
  const handleSubMenuOpen = (event) => setSubMenuAnchorEl(event.currentTarget);
  const handleSubMenuClose = () => setSubMenuAnchorEl(null);

  return (
    <AppBar
      sx={{
        backgroundColor: "white",
        boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)",
        position: "fixed",
      }}
    >
      <Toolbar sx={{ display: "flex", justifyContent: "space-between" }}>
        {/* Logo */}
        <img
          src="https://cdn2.mymoneymantra.com/white_logo_d23b343666.webp?format=avif&quality=80&width=195&height=55"
          alt="logo"
          style={{
            filter: "invert(41%) sepia(95%) saturate(5935%) hue-rotate(162deg)",
            marginTop: "20px",
            marginBottom: "20px",
          }}
        />

        {/* Navigation Links */}
        <Box sx={{ display: "flex", gap: 7, ml: 2 }}>
          {/* Credit Cards Dropdown */}
          <Box
            onMouseEnter={handleMenuOpen}
            onMouseLeave={handleMenuClose}
            sx={{ position: "relative", display: "flex", alignItems: "center", cursor: "pointer" }}
          >
            <Typography
              sx={{
                color: "#0097a7",
                fontWeight: 700,
                fontSize: "16px",
                transition: "color 0.3s",
                display: "flex",
                alignItems: "center",
                "&:hover": { color: "#00788c" },
              }}
            >
              Credit Cards <ArrowDropDownIcon sx={{ fontSize: "20px", color: "#0097a7" }} />
            </Typography>

            {/* Dropdown Menu */}
            <Menu
              anchorEl={anchorEl}
              open={Boolean(anchorEl)}
              onClose={handleMenuClose}
              MenuListProps={{ onMouseLeave: handleMenuClose }}
              sx={{
                mt: 1,
                "& .MuiPaper-root": { width: "250px" },
              }}
            >
              {creditCards.map((card, index) => (
                <MenuItem
                  key={index}
                  onMouseEnter={handleSubMenuOpen}
                  onMouseLeave={handleSubMenuClose}
                  sx={{
                    color: "#0097a7",
                    fontWeight: 700,
                    fontSize: "16px",
                    display: "flex",
                    justifyContent: "space-between",
                    alignItems: "center",
                    "&:hover": { backgroundColor: "#f0f0f0" },
                  }}
                >
                  {card.name}
                  <ArrowRightIcon sx={{ fontSize: "18px", color: "#0097a7" }} />
                  
                  {/* Submenu */}
                  {subMenuAnchorEl && (
                    <Menu
                      anchorEl={subMenuAnchorEl}
                      open={Boolean(subMenuAnchorEl)}
                      onClose={handleSubMenuClose}
                      sx={{
                        position: "absolute",
                        left: "100%",
                        top: 0,
                        mt: -2,
                        "& .MuiPaper-root": { width: "220px" },
                      }}
                    >
                      {card.details.map((detail, i) => (
                        <MenuItem
                          key={i}
                          sx={{
                            color: "#0097a7",
                            fontWeight: 700,
                            fontSize: "14px",
                            "&:hover": { backgroundColor: "#f0f0f0" },
                          }}
                        >
                          {detail}
                        </MenuItem>
                      ))}
                    </Menu>
                  )}
                </MenuItem>
              ))}
            </Menu>
          </Box>

          {/* Other Navbar Items */}
          {["Loan", "Insurance", "EMI Calculator", "Credit Score", "Blogs"].map((item) => (
            <Typography
              key={item}
              sx={{
                color: "#0097a7",
                fontWeight: 700,
                fontSize: "16px",
                cursor: "pointer",
                transition: "color 0.3s",
                "&:hover": { color: "#00788c" },
              }}
            >
              {item}
            </Typography>
          ))}
        </Box>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
